- input: "TEXT\x1CC00461772\x1C.TEXT\x1C\x1CF3XA\x1CPursuant to the RFAI as to this
    report, item #2 has been corrected (incorrect district # of candidate).  With
    respect to RFAI item #1, this committee engaged in best efforts to obtain the
    identification information of donors.  First, solicitations made on all online
    donation pages include clear and conspicuous request for such information and
    inform contributors of the requirement of federal law for the reporting of such
    information, and is a required field to complete donations. Second, for online
    contributors who did not provide such information or used non-compliant answers,
    at least one email was sent requesting that information through an online page
    that clearly asks for the missing information, without soliciting a contribution,
    and informs the contributor of the requirements of federal law for the reporting
    of such information.  Third, for contributors who chose to mail checks (this Committee
    only solicit contributions via its website) without the information, at least
    one follow-up, stand alone effort was made to obtain this information by mail,
    without soliciting a contribution, informing the contributor of the requirements
    of federal law for the reporting of such information, and included a pre-addressed
    return envelope and a URL to provide the information.\n"
